import React, { useEffect, useState } from 'react';
import api from '../api/axios';

const MySalary = () => {
  const [salaries, setSalaries] = useState([]);

  useEffect(() => {
    api.get('/salaries/my').then((res) => setSalaries(res.data.salaries || []));
  }, []);

  return (
    <div className="page">
      <div className="page-header">
        <div>
          <h2>My salary</h2>
          <p className="muted">View your salary history.</p>
        </div>
      </div>

      <div className="card">
        <div className="table">
          <div className="table-row table-head">
            <span>Period</span>
            <span>Base</span>
            <span>Net salary</span>
          </div>
          {salaries.map((salary) => (
            <div key={salary._id} className="table-row">
              <span>{salary.month}/{salary.year}</span>
              <span>{salary.baseSalary}</span>
              <span>{salary.netSalary}</span>
            </div>
          ))}
          {!salaries.length && <div className="muted">No salary records yet.</div>}
        </div>
      </div>
    </div>
  );
};

export default MySalary;
